INSERT INTO "products" VALUES(33,'Nite Rider MiNewt 250 Cordless Bike Light','The MiNewt.250 Cordless bike light is a compact light that can be used for both commuting and trail riding. It outputs 250 lumens and runs 2.5 hours on the high setting. Provides 3 light levels and a flashing mode, and run times range from 2.5 - 4.5 hours. Together with highly efficient reflectors, the ultrabright LED delivers a nice, even light pattern void of rings or halos. ','The MiNewt.250 Cordless bike light is a compact light that can be used for both commuting and trail riding. It outputs 250 lumens and runs 2.5 hours on the high setting.','http://www.rei.com/product/807417','Cool-Stuff','product2_largeCS.png','product2_thumbCS.png','2010-12-09 02:12:48.769356','2010-12-10 16:56:47.051620',12900);
INSERT INTO "products" VALUES(34,'The North Face Whitby Deluxe Insulated Jacket','Quiet and abrasion-resistant 2-layer HyVent™ coated nylon is completely waterproof, windproof and breathable; fully sealed seams prevent moisture seepage. Jacket uses 100% recycled polyester fiber insulation (100g in body, 80g in sleeves/hood) for soft, cozy warmth that is extremely resilient, water repellent and hypoallergenic. Slick embossed and quilted polyester taffeta lining helps wick away moisture, dries fast and eases layering. Detachable hood is fully adjustable to ensure a weather-blocking, personalized fit.','The North Face Whitby Deluxe women''s insulated jacket appeases the backcountry fashionistas with a pea-coat-inspired tweed fabric that is insulated, waterproof and breathable.','http://www.rei.com/product/801607','Northwest-Rugged','product2_largeNW.png','product2_thumbNW.png','2010-12-09 02:19:25.642738','2010-12-09 04:17:13.235441',34900);
