INSERT INTO "products" VALUES(37,'Columbia Bugaboo 3-in-1 Jacket','Omni-Tech™ nylon shell resists abrasion and breathes well; critically taped seams and a waterproof coating block moisture. Nylon taffeta shell lining wicks moisture, dries quickly and holds its shape over layers. Adjustable hood detaches easily so you can leave it behind when you don''t want it. Shell features 2 zippered handwarmer pockets and an interior security pocket to stash a few on-the-slope essentials.','The Columbia Bugaboo 3-in-1 plus-size jacket for women features a removable fleece liner and winter-friendly features. Comfortable, all-purpose performance at a great price!','http://www.rei.com/product/801341','Northwest-Rugged','product3_largeNW.png','product3_thumbNW.png','2010-12-09 02:42:30.369772','2010-12-09 04:21:09.880414',16995);
