INSERT INTO "products" VALUES(40,'Paratrooper 15" Laptop Bag','Fits iPads, Netbooks and laptops with up to a 15" screen (This laptop sleeve was tested using a 15" Macbook Pro.) Approximate Dimensions: 13" h x 9 1/2" w x 2" d. Features include:  Main compartment padded with Neoprene for protection, foldover top with vecro closure on main compartment , two small pockets with fold over top and snap closure to hold small objects.  Large pouch pocket on back to hold power cord and accessories . ','Fits iPads, Netbooks and laptops with up to a 15" screen (This laptop sleeve was tested using a 15" Macbook Pro.)','http://www.brooklynindustries.com/index.cfm/fuseaction/product.detail/_/Paratrooper-15quot-Laptop-Bag/productID/3f7600d7-422a-4339-92e8-b694bafc883c/categoryID/22f82371-102d-496b-9b30-fc32ed230b2c','Under-50','paratrooper15LaptopBag.jpg','paratrooper15LaptopBag(small).jpg','2010-12-09 02:46:53.612432','2010-12-09 04:37:20.370027',2999);
