INSERT INTO "products" VALUES(42,'The PreCip® rainpants from Marmot®','Waterproof and breathable, these all-season pants are ultra lightweight, packable and perfect for low-abrasion conditions. PreCip coating provides high breathability and waterproofness. Dry Touch™ finish with a dimensional print reduces condensation, eliminating that clammy feeling. Fully taped seams ensure waterproofness. Full-length side zippers with drawcord cuffs and snap closures allow easy on/off without removing boots. ','Waterproof and breathable, these all-season pants are ultra lightweight, packable and perfect for low-abrasion conditions.','http://www.rei.com/product/738907','Northwest-Rugged','precipRainpants.jpg','precipRainpants(small).jpg','2010-12-09 02:51:40.420135','2010-12-09 04:40:54.547147',5983);
INSERT INTO "products" VALUES(43,'Arc''teryx Theta AR Jacket','Full-featured Gore-Tex™ Pro Shell storm shelter with clean styling and multi-sport versatility. Theta AR is the longest length jacket from Arc''teryx and offers maximum coverage; the Drop Hood™ with a tall collar provides quick access to head protection. Made from supple Gore-Tex™ 3L Pro Shell fabric, Theta AR is completely waterproof and windproof, and offers excellent breathability. Gore Micro Grid lining is a thin, low-denier, low-density woven fabric that allows the shell to slide easily over midlayers. ','Full-featured Gore-Tex™ Pro Shell storm shelter with clean styling and multi-sport versatility.','http://www.rei.com/product/803360','Northwest-Rugged','arcteryxThetaArJacket.jpg','arcteryxThetaArJacket(small).jpg','2010-12-09 02:54:28.787060','2010-12-09 04:43:03.371632',49900);
INSERT INTO "products" VALUES(44,'Outdoor Research Crocodile Gaiters','The Outdoor Research Crocodile® gaiters keep snow out of your boots while climbing mountains, cross-country skiing or hiking over snow fields. Gore-Tex®/Taslan® nylon uppers are waterproof and breathable; durable lower panels of coated Cordura® nylon are lined with packcloth. Changing the amount of overlap on the 2-inch wide hook and loop closure adjusts the bottom circumference, allowing a fit over different boots.','The Outdoor Research Crocodile® gaiters keep snow out of your boots while climbing mountains, cross-country skiing or hiking over snow fields.','http://www.rei.com/product/725915','Northwest-Rugged','OutdoorResearchCrocodileGaiters.jpg','OutdoorResearchCrocodileGaiters(small).jpg','2010-12-09 02:55:36.164680','2010-12-09 05:01:17.553609',6500);
INSERT INTO "products" VALUES(45,'Mountain Hardwear Epic Gloves','The Mountain Hardwear Epic gloves keep hands warm and dry while swinging ice tools, grasping ski poles and packing snowballs. Updated to include OutDry® Extreme Waterproof laminate technology, making the gloves completely waterproof and windproof. Brushed polyester lining wicks away excess moisture, so hands stay dry and warm. Exterior Conduit™ Silk nylon shell is durable yet lightweight.','The Mountain Hardwear Epic gloves keep hands warm and dry while swinging ice tools, grasping ski poles and packing snowballs.','http://www.rei.com/product/786711','Northwest-Rugged','MountainHardwearEpicGloves.jpg','MountainHardwearEpicGloves(small).jpg','2010-12-09 02:56:56.435325','2010-12-09 05:04:13.089486',6000);
INSERT INTO "products" VALUES(46,'Merrell Tetra Launch Waterproof Boots','Full-grain waterproof leather uppers feature medial zippers and discreet elastic gores for easy entry and a snug fit. Nylon mesh linings deliver effective moisture management while Polartec® footbed covers supply subtle warmth. Anatomic footbeds with Cita-XY™ AEGIS™ Microbe Shield antimicrobial finish keep shoes fresh. Polyurethane midsoles with Air Cushion® heel pockets absorb shock and supply ample cushioning for comfort, mile after mile. Injection-molded nylon arch shanks ensure dependable support Q-Form™ alignment system provides women with a precise anatomic fit for superb, tailored comfort. ','Full-grain waterproof leather uppers feature medial zippers and discreet elastic gores for easy entry and a snug fit.','http://www.rei.com/product/773642','Northwest-Rugged','product4_largeNW.png','product4_thumbNW.png','2010-12-09 02:57:12.897610','2010-12-09 05:06:12.407770',15000);
INSERT INTO "products" VALUES(47,'Injinji Tetratsok Micro Mini Socks','Like gloves for your feet, these innovative micro mini "toe socks" virtually prevent blisters with a seamless construction that protects each toe. Anatomical Molding System™ with CoolMax® polyester conforms to your feet for increased blood and air circulation. Individual anatomical toe sleeves form a thin anti-blister membrane between toes to eliminate skin-against-skin friction. 3-ply flex construction prevents sock movement while increasing wicking and circulation.','Like gloves for your feet, these innovative micro mini "toe socks" virtually prevent blisters with a seamless construction that protects each toe.','http://www.rei.com/product/728371','Northwest-Rugged','InjinjiTetratsokMicroMiniSocks.jpg','InjinjiTetratsokMicroMiniSocks(small).jpg','2010-12-09 02:58:09.654005','2010-12-09 05:08:05.213637',1200);
INSERT INTO "products" VALUES(48,'SmartWool Mountaineer Socks','High-performance SmartWool Mountaineer socks are designed for maximum comfort, protection and warmth over extended periods. Extra-thick 3 x 1 knit with mid-calf design provides extra protection and a snug fit. Natural merino wool features long, silky fibers for extra warmth and comfort without wool''s itchiness. High-density sole padding cushions against shock, blisters and abrasions; high-density padded insteps and shins protects against lace pressure. Lycra® spandex arch braces for increased support and comfort. ','High-performance SmartWool Mountaineer socks are designed for maximum comfort, protection and warmth over extended periods.','http://www.rei.com/product/618127','Northwest-Rugged','SmartWoolMountaineerSocks.jpg','SmartWoolMountaineerSocks(small).jpg','2010-12-09 02:59:29.583416','2010-12-09 05:09:30.319440',2295);
INSERT INTO "products" VALUES(49,'The North Face STH Softshell Shell Pants','The North Face Apex ClimateBlock soft-shell fabric is virtually waterproof and windproof, and maintains a comfortable level of breathability and 4-way stretch. Polyurethane-coated outer face provides near waterproof performance while soft fleece inner face traps and holds heat for comfort all day long. Durable Water Repellent finish increases water, wind, and stain-resistance. Features twin zippered handwarmer pockets and a stash pocket on lower calf. Low-rise waist with concealed adjustment tabs allows you to dial in the fit. ','The North Face Apex ClimateBlock soft-shell fabric is virtually waterproof and windproof, and maintains a comfortable level of breathability and 4-way stretch. ','http://www.rei.com/product/801624','Northwest-Rugged','product5_largeNW.png','product5_thumbNW.png','2010-12-09 02:59:56.219898','2010-12-09 05:10:50.574036',14900);
INSERT INTO "products" VALUES(50,'Lands'' End Men''s Cotton Argyle Dress Socks','Once you try our seamless-toe socks, you won''t want to wear any others. The toes are closed by passing single yarns through the loops (it''s a slower process called "hand looping") to create uninterrupted fabric, which means more comfort per foot. Premium combed cotton, with its long, smooth fibers, brings out the rich color saturation; rib knit cuffs help keep them up so the Argyle pattern has a smooth appearance all day. 92% Combed cotton/7% polyester/1% Spandex. ','Once you try our seamless-toe socks, you won''t want to wear any others.','http://www.amazon.com/Lands-End-Cotton-Argyle-Dress/dp/B004CVQ5L6/ref=sr_1_2?s=apparel&ie=UTF8&qid=1291260393&sr=1-2&searchContext=B004CVO8J2,B004CVQ5L6,B004CVPYUO,B004CVH2GI,B004CWWH9Y,B0044DE6DQ,B001E5DP70,B004CWZDL8,B001VEID9O,B0044DE6M2,B004CVPWYC,B004CWYJ7M,B004CX3N8M,B004CX0D0I,B004CX0862,B001VH6UW8,B001UIO9S0,B0018NA4G8,B002YBL1J2,B001VEIDEY,B003XKNB2I,B003H6Y69K,B004BP0YNS,B001UIM5PO','Cool-Stuff','LandsEndMens CottonArgyle DressSocks.jpg','LandsEndMens CottonArgyle DressSocks_thumb.jpg','2010-12-09 03:01:09.998866','2010-12-09 05:13:14.107163',1450);
INSERT INTO "products" VALUES(51,'Everest Designs Sherpa Earflap Hat','Offering traditional warmth and a fun design, this wool Everest Designs Sherpa earflap hat is handcrafted by women''s knitting cooperatives in Nepal. Fully lined in plush, dense fleece, this tightly knit wool hat gives you the benefit of 2 layers of heat-trapping fibers. Wool''s natural stretch provides a comfortable fit, and the earflaps guarantee warm lobes when breezes blow cold. Detailed with braided tassels at the top and at the ear flaps.','Offering traditional warmth and a fun design, this wool Everest Designs Sherpa earflap hat is handcrafted by women''s knitting cooperatives in Nepal.','http://www.rei.com/product/788217','Northwest-Rugged','product6_largeNW.png','product6_thumbNW.png','2010-12-09 03:02:10.591129','2010-12-09 03:02:23.114386',2900);
