INSERT INTO "products" VALUES(56,'Argyle Plaid Scarf ','New design trademarked, even softer than cashmere! Classic argyle/plaid design provides great warmth in cold weather. Everyone needs a scarf! Matching accessories include gloves, hats, earmuffs, coordinate sets and so much more in our store.','New design trademarked, even softer than cashmere!','http://www.amazon.com/Winter-Softer-Cashmere-Scarf-Argyle/dp/B004807WGS/ref=sr_1_1?s=apparel&ie=UTF8&qid=1291261293&sr=1-1&searchContext=B004807WGS,B0010B0DIM,B00450APG0,B00480BN3Q,B002PHNVJ8,B00478UOMK,B003KACMXA,B0045FT296,B002PHNW24,B0045FSCEW,B0045ZYLWE,B004804G9E,B00478TXD6,B0045FV2OE,B0046EHXSI,B0045FT2EG,B004AQ9PX8,B004804GEE,B0045FZ1FA,B004807WR2,B0045070M2,B00450X2Q0,B004809OGE,B002PHNV7K','Cool-Stuff','argyleScarf.jpg','argyleScarf(small).jpg','2010-12-09 03:08:32.444566','2010-12-09 03:29:13.093404',1495);
INSERT INTO "products" VALUES(57,'DuoTrap Digital Speed/Cadence Sensor','Say goodbye to zip ties! The DuoTrap sensor is an ANT+ compatible 2.4GHz wireless sensor that fits directly into the chainstay of certain Trek bicycles for a clean look that preserves aerodynamics and installs in seconds providing both speed and cadence signals.','Say goodbye to zip ties! The DuoTrap sensor is an ANT+ compatible 2.4GHz wireless sensor that fits directly into the chainstay of certain Trek bicycles for a clean look that preserves aerodynamics and installs in seconds providing both speed and cadence signals.','http://www.bontrager.com/model/08298','Cool-Stuff','product3_largeCS.png','product3_thumbCS.png','2010-12-10 17:12:33.172047','2010-12-10 17:12:50.093022',5999);
INSERT INTO "products" VALUES(58,'Node 2 Digital','The Node 2 reads the same ANT+ signals and provides the same great functions as the Node 1 computers with the addition of altitude and percent grade. The water-resistant design allows for all year riding, the back light keeps you informed at dusk and dawn and the included Soft-Strap heart rate monitor keeps you abreast of your body''s changing conditions on the ride.','The Node 2 reads the same ANT+ signals and provides the same great functions as the Node 1 computers with the addition of altitude and percent grade.','http://www.bontrager.com/model/08205','Cool-Stuff','product1_largeCS.png','product1_thumbCS.png','2010-12-10 17:14:48.602799','2010-12-10 17:15:03.162385',139);
INSERT INTO "products" VALUES(59,'Race X Lite Carbon Cage','The revised full carbon shape reduces weight and wraps tighter around the bottle while the rubber grippers provide additional bottle hold.','The revised full carbon shape reduces weight and wraps tighter around the bottle while the rubber grippers provide additional bottle hold.','http://www.bontrager.com/model/08367','Cool-Stuff','product4_largeCS.png','product4_thumbCS.png','2010-12-10 17:19:17.005282','2010-12-10 17:19:30.520125',4999);
INSERT INTO "products" VALUES(60,'Laidback Rack','Designed specifically to fit Trek''s Pure line of comfort bikes, the Laidback Rack instantly adds hauling capacity to your ride. Interchange compatibility means there are a full range of Bontrager trunks, panniers, and bags that install and remove in a snap.','Designed specifically to fit Trek''s Pure line of comfort bikes, the Laidback Rack instantly adds hauling capacity to your ride.','http://www.bontrager.com/model/06972','Cool-Stuff','product5_largeCS.png','product5_thumbCS.png','2010-12-10 17:24:53.910475','2010-12-10 17:25:10.414374',3999);
INSERT INTO "products" VALUES(61,'Nimbus 24" MUni Cycle (Orange)','Muni riding is about attacking the big stuff, the small stuff and everything in between. From the tallest peaks to the most technical descents. The Nimbus 24" Muni is easily the most versatile unicycle you could own on the market at a knock out price!','Muni riding is about attacking the big stuff, the small stuff and everything in between. From the tallest peaks to the most technical descents.','http://www.unicycle.com/hot-products/nimbus-24-inch-muni-cycle-1.html/','Cool-Stuff','product6_largeCS.png','product6_thumbCS.png','2010-12-10 17:30:47.377767','2010-12-10 17:31:01.029521',24000);
INSERT INTO "products" VALUES(62,'The North Face Grace Rain Jacket ','The North Face Grace Jacket is city savvy and technically adept. Hyvent™ DT 2.5-layer fabric has a microdot inner print and a waterproof barrier that channels moisture outward. Jacket is waterproof yet still lets you breathe easy; all seams are sealed for complete protection. Hood is adjustable and can be completely removed when not wanted.','The North Face Grace Jacket is city savvy and technically adept.','http://www.rei.com/product/770691','Northwest-Rugged','product1_largeNW.png','product1_thumbNW.png','2010-12-10 17:38:57.256825','2010-12-10 17:39:11.375729',19900);
